          '<html>\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/html; charset=utf-8">\r\n<meta name="Generator" content="Microsoft Word 15 (filtered medium)">\r\n<style>\r\n<!--\r\n@font-face\r\n\t{font-family:"Cambria Math"}\r\n@font-face\r\n\t{font-family:Calibri}\r\n@font-face\r\n\t{font-family:"Gill Sans MT"}\r\np.MsoNormal, li.MsoNormal, div.MsoNormal\r\n\t{margin:0in;\r\n\tfont-size:11.0pt;\r\n\tfont-family:"Calibri",sans-serif}\r\nspan.EmailStyle20\r\n\t{font-weight:bold}\r\n.MsoChpDefault\r\n\t{font-size:10.0pt}\r\n@page WordSection1\r\n\t{margin:1.0in 1.0in 1.0in 1.0in}\r\ndiv.WordSection1\r\n\t{}\r\n-->\r\n</style>\r\n</head>\r\n<body lang="EN-US" link="#0563C1" vlink="#954F72" style="word-wrap:break-word">\r\n<div class="WordSection1">\r\n<div>\r\n<p class="MsoNormal"><b>PLEASE COMPLETE ALL WEEKLY TIMESHEETS BY <span style="color:red">\r\nFRIDAY EVENING</span></b></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-family:&quot;Times New Roman&quot;,serif">Team,</span></p>\r\n<p><span style="color:#252525">Due to the current situation and market liquidity crunch, we have made a decision, along with our accounting team, that we are going to bill all our invoices promptly on the 1<sup>st</sup> of every month, and with some clients\r\n on a weekly basis.</span></p>\r\n<p><span style="color:#252525">&nbsp;We want you and your respective team members to ensure that by the end of every Friday and by the end of every month, all your team or individual hours are\r\n<strong><span style="font-family:&quot;Calibri&quot;,sans-serif">properly and completely</span></strong> logged in to Sai timesheet system. This is very critical for us as an organization to be able to have this data available for accounts so that they can send out the\r\n invoices by the 1<sup>st</sup> of the month. This would enable us to collect in time and reduce the risk of delayed or missed payments from our clients.</span></p>\r\n<p><span style="color:red">Please make sure everyone enters their hours, including leaves and holidays. Example: March\'s weekday total is 23 = 23* 8 = 184 hours. So, all full-time employees entered a minimum of 184 hours for March in our timesheet system. These\r\n total hours will be different for each month. It is totally based on total weekdays. I am not 100% expecting the same for contractors and part-timers.</span></p>\r\n<p><span style="color:#252525">&nbsp;If anyone has any questions, please contact me. Thank you, and we appreciate your support in helping us achieve this timeline.</span></p>\r\n<p class="MsoNormal"><span style="font-family:&quot;Times New Roman&quot;,serif">Be Healthy and Stay Safe.</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size:12.0pt">Thanks</span></p>\r\n<p class="MsoNormal"><span style="font-size:12.0pt; color:#1F497D">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size:10.0pt">Venkata S Kota</span></p>\r\n<p class="MsoNormal"><span style="font-size:10.0pt">SAISystems International Inc.</span></p>\r\n<p class="MsoNormal" style="text-autospace:none"><span style="font-size:8.0pt; font-family:&quot;Gill Sans MT&quot;,sans-serif; color:black">5 Research Drive, Shelton, CT&nbsp;06484&nbsp; | Office: 203-567-5217 | Fax: 203-929-6948 | Mobile: 203-278-9490</span></p>\r\n<p class="MsoNormal"><span style="color:#5F5F5F">________________________________________________________________________________</span>\r\n</p>\r\n</div>\r\n<p class="MsoNormal">&nbsp;</p>\r\n</div>\r\n</body>\r\n</html>\r\n',
